import React from "react";

const Card = () => {
  return (
    <div className="col-md-3">
      <img
        src="https://images.pexels.com/photos/1640777/pexels-photo-1640777.jpeg?auto=compress&cs=tinysrgb&dpr=1&w=500"
        alt="Image Not Found"
      />
    </div>
  );
};
const Products = () => {
  return (
    <>
      <div className="row">
        <Card />
        <Card />
        <Card />
      </div>
    </>
  );
};

export default Products;
